import React from 'react';

const NotToDo = ({nottodo,deleteNotTodo}) =>{
    
    const nottodoList = nottodo.length ? (
        nottodo.map(notdo => {
            return (
                <div className='collection-item' key={notdo.id}>
                    <span onClick={() => {deleteNotTodo(notdo.id)}} >{notdo.content}</span>
                </div>
            )
        })
    ) : (
        <p>
            Not todos anymore
        </p>
    )
    return(
        <div>
            <h1 className='center'>
                Not To Do
            </h1>
            <div className="collection">
            {nottodoList}

            </div>
        </div>
    )
}

export default NotToDo;
